import React from 'react';
import { Link } from "react-router-dom";

const Menu = () => (
  <div>
    <Link to="/"></Link>
    <Link to="/signup"></Link>
    <Link to="/signin"></Link>
    <Link to="/signout"></Link>
  </div>
);

export default Menu;
